export default function userReducer(state, action) {
  switch (action.type) {
    case "updateName":
      console.log(state);

      let data = fetch("https://samples.openweathermap.org/data/2.5/weather?q=London,uk&appid=439d4b804bc8187953eb36d2a8c26a02")
        .then((res) => res.json())
        .then((res) => {
          if (res.error) {
            throw res.error;
          }

          return res.products;
        })
        .catch((error) => {
          console.log(error);
        });

      return [...state, data];
    default:
      return state;
  }
}
